import React from 'react'
import ReactDOM from 'react-dom'

const TodoList = () => {
    return (
        <ul>
            <li>Todo first</li>
            <li>Todo second</li>
        </ul>

    )
}

const AppHeader = () => {
    return (
       <h1>Todo List</h1> 
    )
}

const el = (
    <div>
        <AppHeader>dddd</AppHeader>
        <input placeholder="search" />
        <TodoList></TodoList>
    </div>
)

ReactDOM.render(el, document.getElementById('root'))
